    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation. The All Roads Shapefile includes all features within the MTDB Super Class
    "Road/Path Features"n               distinguished where the MAF/TIGER Feature
    Classification Code (MTFCC) for the feature in MTDB that begins with "S". This
    includes all primary, secondary,n               local neighborhood, and rural roads,
    city streets, vehicular trails (4wd), ramps, service drives, alleys, parking lot
    roads, private roads for servicen               vehicles (logging, oil fields, ranches,
    etc.), bike paths or trails, bridle/horse paths, walkways/pedestrian trails, and
    stairways.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
